_sourceCategory="prod/fortigate" and _collector="syslogsrv03"
| parse regex " act=(?<act>.*?) " nodrop | parse regex " action=(?<action>.*?) " nodrop | parse regex " alert=(?<alert>.*?) " nodrop | parse regex " app=(?<app>.*?) " nodrop | parse regex " appcat=(?<appcat>.*?) " nodrop | parse regex " assignip=(?<assignip>.*?) " nodrop | parse regex " auditid=(?<auditid>.*?) " nodrop | parse regex " auditscore=(?<auditscore>.*?) " nodrop | parse regex " audittime=(?<audittime>.*?) " nodrop | parse regex "authserver=\"(?<authserver>.*?)\"" nodrop | parse regex " bandwidth=(?<bandwidth>.*?) " nodrop | parse regex " cat=(?<cat>.*?) " nodrop | parse regex " catdesc=(?<catdesc>.*?) " nodrop | parse regex " cookies=(?<cookies>.*?) " nodrop | parse regex " count=(?<count>.*?) " nodrop | parse regex " countweb=(?<countweb>.*?) " nodrop | parse regex " cpu=(?<cpu>.*?) " nodrop | parse regex " craction=(?<craction>.*?) " nodrop | parse regex " criticalcount=(?<criticalcount>.*?) " nodrop | parse regex " crlevel=(?<crlevel>.*?) " nodrop | parse regex " crscore=(?<crscore>.*?) " nodrop | parse regex " datarange=(?<datarange>.*?) " nodrop | parse regex " desc=(?<desc>.*?) " nodrop | parse regex " devcategory=(?<devcategory>.*?) " nodrop | parse regex " devid=(?<devid>.*?) " nodrop | parse regex " devname=(?<devname>.*?) " nodrop | parse regex "devtype=\"(?<devtype>.*?)\"" nodrop | parse regex " dir=(?<dir>.*?) " nodrop | parse regex " direction=(?<direction>.*?) " nodrop | parse regex " disk=(?<disk>.*?) " nodrop | parse regex " disklograte=(?<disklograte>.*?) " nodrop | parse regex "\"dstcountry=(?<dstcountry>.*?)\"" nodrop | parse regex " dstdevcategory=(?<dstdevcategory>.*?) " nodrop | parse regex "\"dstdevtype=(?<dstdevtype>.*?)\"" nodrop | parse regex " dstintf=(?<dstintf>.*?) " nodrop | parse regex " dstintfrole=(?<dstintfrole>.*?) " nodrop | parse regex " dstip=(?<dstip>.*?) " nodrop | parse regex " dstmac=(?<dstmac>.*?) " nodrop | parse regex "\"dstosname=(?<dstosname>.*?)\"" nodrop | parse regex " dstport=(?<dstport>.*?) " nodrop | parse regex " dstserver=(?<dstserver>.*?) " nodrop | parse regex " duration=(?<duration>.*?) " nodrop | parse regex " epoch=(?<epoch>.*?) " nodrop | parse regex " espauth=(?<espauth>.*?) " nodrop | parse regex " esptransform=(?<esptransform>.*?) " nodrop | parse regex " eventtime=(?<eventtime>.*?) " nodrop | parse regex " eventtype=(?<eventtype>.*?) " nodrop | parse regex " exch=(?<exch>.*?) " nodrop | parse regex " fazlograte=(?<fazlograte>.*?) " nodrop | parse regex " fcni=(?<fcni>.*?) " nodrop
| where !isEmpty(devtype) //作業用。ここに検索したいフィールドを入力
| timeslice 1s
//| count by devtype //作業用
| count by _timeslice, act, action, alert, app, appcat, assignip, auditid, auditscore, audittime, authserver, bandwidth, cat, catdesc, cookies, count, countweb, cpu, craction, criticalcount, crlevel, crscore, datarange, desc, devcategory, devid, devname, devtype, dir, direction, disk, disklograte, dstcountry, dstdevcategory, dstdevtype, dstintf, dstintfrole, dstip, dstmac, dstosname, dstport, dstserver, duration, epoch, espauth, esptransform, eventtime, eventtype, exch, fazlograte, fcni
| fields - _count
//| sort by eventtime //作業用

//バリュー名に空白がある場合、正しくバリュー名を拾えない可能性があります。
//フィールドの値の一覧を表示するためには、「作業用」と行末に書かれた行のみをコメントアウトしてください。
_sourceCategory="prod/fortigate" and _collector="syslogsrv03"
| parse regex " fctuid=(?<fctuid>.*?) " nodrop | parse regex " fdni=(?<fdni>.*?) " nodrop | parse regex " file=(?<file>.*?) " nodrop | parse regex " filesize=(?<filesize>.*?) " nodrop | parse regex " from=(?<from>.*?) " nodrop | parse regex " group=(?<group>.*?) " nodrop | parse regex " handshake=(?<handshake>.*?) " nodrop | parse regex " highcount=(?<highcount>.*?) " nodrop | parse regex " hook=(?<hook>.*?) " nodrop | parse regex " hostname=(?<hostname>.*?) " nodrop | parse regex " identidx=(?<identidx>.*?) " nodrop | parse regex " init=(?<init>.*?) " nodrop | parse regex " interface=(?<interface>.*?) " nodrop | parse regex " ip=(?<ip>.*?) " nodrop | parse regex " kind=(?<kind>.*?) " nodrop | parse regex " lanin=(?<lanin>.*?) " nodrop | parse regex " lanout=(?<lanout>.*?) " nodrop | parse regex " level=(?<level>.*?) " nodrop | parse regex " locip=(?<locip>.*?) " nodrop | parse regex " locport=(?<locport>.*?) " nodrop | parse regex " log=(?<log>.*?) " nodrop | parse regex "logdesc=\"(?<logdesc>.*?)\"" nodrop | parse regex " logid=(?<logid>.*?) " nodrop | parse regex " lowcount=(?<lowcount>.*?) " nodrop | parse regex " masterdstmac=(?<masterdstmac>.*?) " nodrop | parse regex " mastersrcmac=(?<mastersrcmac>.*?) " nodrop | parse regex " mediumcount=(?<mediumcount>.*?) " nodrop | parse regex " mem=(?<mem>.*?) " nodrop | parse regex " method=(?<method>.*?) " nodrop | parse regex " mode=(?<mode>.*?) " nodrop | parse regex " msg=(?<msg>.*?) " nodrop | parse regex " name=(?<name>.*?) " nodrop | parse regex " nextstat=(?<nextstat>.*?) " nodrop | parse regex " osname=(?<osname>.*?) " nodrop | parse regex " outintf=(?<outintf>.*?) " nodrop | parse regex " passedcount=(?<passedcount>.*?) " nodrop | parse regex " policyid=(?<policyid>.*?) " nodrop | parse regex " policytype=(?<policytype>.*?) " nodrop | parse regex " poluuid=(?<poluuid>.*?) " nodrop | parse regex " processtime=(?<processtime>.*?) " nodrop | parse regex " profile=(?<profile>.*?) " nodrop | parse regex " proto=(?<proto>.*?) " nodrop | parse regex " rcvdbyte=(?<rcvdbyte>.*?) " nodrop | parse regex " rcvddelta=(?<rcvddelta>.*?) " nodrop | parse regex " rcvdpkt=(?<rcvdpkt>.*?) " nodrop | parse regex "\"reason=(?<reason>.*?)\"" nodrop | parse regex " referralurl=(?<referralurl>.*?) " nodrop | parse regex " remip=(?<remip>.*?) " nodrop | parse regex " remport=(?<remport>.*?) " nodrop | parse regex " reporttype=(?<reporttype>.*?) " nodrop
//| where !isEmpty(dir) //作業用。ここに検索したいフィールドを入力
| timeslice 1s
| count by _timeslice, fctuid, fdni, file, filesize, from, group, handshake, highcount, hook, hostname, identidx, init, interface, ip, kind, lanin, lanout, level, locip, locport, log, logdesc, logid, lowcount, masterdstmac, mastersrcmac, mediumcount, mem, method, mode, msg, name, nextstat, osname, outintf, passedcount, policyid, policytype, poluuid, processtime, profile, proto, rcvdbyte, rcvddelta, rcvdpkt, reason, referralurl, remip, remport, reporttype
| fields - _count

//バリュー名に空白がある場合、正しくバリュー名を拾えない可能性があります。
//フィールドの値の一覧を表示するためには、「作業用」と行末に書かれた行のみをコメントアウトしてください。
_sourceCategory="prod/fortigate" and _collector="syslogsrv03"
| parse regex " reqtype=(?<reqtype>.*?) " nodrop| parse regex " result=(?<result>.*?) " nodrop| parse regex " role=(?<role>.*?) " nodrop| parse regex " sentbyte=(?<sentbyte>.*?) " nodrop| parse regex " sentdelta=(?<sentdelta>.*?) " nodrop| parse regex " sentpkt=(?<sentpkt>.*?) " nodrop| parse regex " seq=(?<seq>.*?) " nodrop| parse regex " service=(?<service>.*?) " nodrop| parse regex " sessionid=(?<sessionid>.*?) " nodrop| parse regex " setuprate=(?<setuprate>.*?) " nodrop| parse regex " spi=(?<spi>.*?) " nodrop| parse regex " srccountry=(?<srccountry>.*?) " nodrop| parse regex " srcintf=(?<srcintf>.*?) srcintfrole" nodrop| parse regex " srcintfrole=(?<srcintfrole>.*?) " nodrop| parse regex " srcip=(?<srcip>.*?) " nodrop| parse regex " srcmac=(?<srcmac>.*?) " nodrop| parse regex " srcname=(?<srcname>.*?) " nodrop| parse regex " srcport=(?<srcport>.*?) " nodrop| parse regex " srcserver=(?<srcserver>.*?) " nodrop| parse regex " sslaction=(?<sslaction>.*?) " nodrop| parse regex " stage=(?<stage>.*?) " nodrop| parse regex " status=(?<status>.*?) " nodrop| parse regex " subtype=(?<subtype>.*?) " nodrop| parse regex " to=(?<to>.*?) " nodrop| parse regex " total=(?<total>.*?) " nodrop| parse regex " totalsession=(?<totalsession>.*?) " nodrop| parse regex " trandisp=(?<trandisp>.*?) " nodrop| parse regex " tranip=(?<tranip>.*?) " nodrop| parse regex " tranport=(?<tranport>.*?) " nodrop| parse regex " transip=(?<transip>.*?) " nodrop| parse regex " transport=(?<transport>.*?) " nodrop| parse regex " tunnelid=(?<tunnelid>.*?) " nodrop| parse regex " tunnelip=(?<tunnelip>.*?) " nodrop| parse regex " tunneltype=(?<tunneltype>.*?) " nodrop| parse regex " type=(?<type>.*?) " nodrop| parse regex " url=(?<url>.*?) " nodrop| parse regex " urlfilteridx=(?<urlfilteridx>.*?) " nodrop| parse regex " used=(?<used>.*?) " nodrop| parse regex " user=(?<user>.*?) " nodrop| parse regex " utmaction=(?<utmaction>.*?) " nodrop| parse regex " vd=(?<vd>.*?) " nodrop| parse regex " version=(?<version>.*?) " nodrop| parse regex " vpn=\"(?<vpn>.*?)\"" nodrop| parse regex " vpntunnel=(?<vpntunnel>.*?) " nodrop| parse regex " vpntype=\"(?<vpntype>.*?)\"" nodrop| parse regex " vwlid=(?<vwlid>.*?) " nodrop| parse regex "\"vwlquality=(?<vwlquality>.*?)\"" nodrop| parse regex " wanin=(?<wanin>.*?) " nodrop| parse regex " wanout=(?<wanout>.*?) " nodrop| parse regex " xauthgroup=(?<xauthgroup>.*?) " nodrop| parse regex " xauthuser=(?<xauthuser>.*?) " nodrop
| parse regex " dstip=(?<dstip>.*?) " nodrop
//| where !isEmpty(vpn) //作業用。ここに検索したいフィールドを入力
| count by reqtype, result, role, sentbyte, sentdelta, sentpkt, seq, service, sessionid, setuprate, spi, srccountry, srcintf, srcintfrole, srcip, srcmac, srcname, srcport, srcserver, sslaction, stage, status, subtype, to, total, totalsession, trandisp, tranip, tranport, transip, transport, tunnelid, tunnelip, tunneltype, type, url, urlfilteridx, used, user, utmaction, vd, version, vpn, vpntunnel, vpntype, vwlid, vwlquality, wanin, wanout, xauthgroup, xauthuser
//| count by dstip, vpn //作業用
| fields - _count  
//| fields vpn, vpntunnel, vpntype //作業用

//dateとtimeフィールドは省略しています。
//ログタイプごとにフィールドの一覧を表示するためには、「作業用」と行末に書かれた行のみをコメントアウトしてください。
_sourceCategory="prod/fortigate" and _collector="syslogsrv03"
| parse regex "\<(?<log_type>\d{1,3})\>" nodrop
//| where log_type = "190"
| parse regex "\<\d{1,3}\>date=\d{1,4}\-\d{1,2}\-\d{1,2} time=\d{1,2}\:\d{1,2}\:\d{1,2}(?<log_body>.+)"
| parse regex field=log_body " (?<field_name>[0-9a-zA-Z_]*?)=.*?" multi
//| where field_name matches "*_*" //作業用
//| where field_name = "fctuid" //作業用
//| where field_name in ("lanin","lanout","vpn","vpntunnel","vpntype") //作業用
| count by field_name , log_type
//| fields - _count //作業用
| transpose row field_name column log_type
//| fields - _count ///作業用

